import React from 'react'
import "./header.css"

const Header = () => {
  return (
    <div className='basic-section'>
      <div className='basic-section-image' id="home">
        <div className='basic-content'>
          <h1 className='basic-text'>Xumor Somsa</h1> 
           <p className='basic-title'>Xumor Somsa sizga an’anaviy ta’mni zamonaviy xizmat bilan taqdim etadi.</p>
          </div>
        </div>
      </div>

  )
}

export default Header;
